import React, { useState } from 'react'
import { Button } from "semantic-ui-react";
import './App.css'
import 'semantic-ui-css/semantic.min.css'
import Switch from 'react-ios-switch'
import { Routes, Route } from 'react-router-dom';
import Login from './examples/Login';
import Advanced from './examples/Advanced'
import HandleRedirect from "./examples/Redirect"; 
import PlaylistsGrid from "./examples/PlaylistsGrid"; 

function App() {
  return (
    <div>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/callback" element={<HandleRedirect />} />{" "}
        <Route path="/playlists" element={<PlaylistsGrid />} />
        <Route path="/content" element={<Advanced />} />
      </Routes>
    </div>
  );
}

export default App;
